import React from 'react'

import ProjectList from './index.data'
import './projectsStyles.css'

import Grid from '@material-ui/core/Grid';


const Projects = () => {

    const forList = (listOfProject) => {
        return listOfProject.map((eachProject) => {
            return (
                <div>

                        <Grid item xs={12} sm={3}>
                            <div className="flip-card-container">
                                <div className="flip-card">
                                    <div className="flip-card-front">

                                        {eachProject.title}
                                    </div>
                                    <div className="flip-card-back">
                                        <p>
                                            {eachProject.title}
                                            <span> {eachProject.description}
                                            <br />
                                            <br />
                                                <a href={eachProject.githubLink}
                                                    target="_blank">
                                                    <img src="Pictures/github.png" className="contactImage" /></a>
                                            </span>
                                        </p>

                                    </div>
                                </div>
                            </div>
                        </Grid>

                </div>
            )
        })
    }

    return (
        <section className="ProjectsPage">
            <div className="mainTitle">Projects</div>
            <hr className="blueLine"/>
            <div id="experienceDetails">
                <Grid container spacing={3}>
                    {forList(ProjectList)}
                </Grid>
            </div>
        </section>
    )
}

export default Projects
